import React from "react";
import profileImg from "../assets/images/ljy.jpg";
import "../css/AboutMe.css";

function AboutMe() {
  return (
    <section id="aboutme">
      <h2>About Me</h2>
      <div className="aboutme-content">
        <img className="aboutme-img" src={profileImg} alt="프로필 이미지" />
        <div className="aboutme-text">
          <p>안녕하세요! 저는 프론트엔드 개발자 이재용입니다.</p>
          <p>사용자 경험을 최우선으로 생각하며, 웹 서비스 UI/UX 설계와 최적화에 관심이 많습니다.</p>
          <p>React와 Vanilla JS를 활용한 웹 프로젝트 경험이 있으며, 팀 프로젝트 및 협업 경험도 풍부합니다.</p>
        </div>
      </div>
    </section>
  );
}

export default AboutMe;
